const results = [];

for (const item of $input.all()) {
  const url = item.json.name;

  const regex = /clickup\.com\/(\d+)\/v\/dc\/([^/]+)/;
  const match = url.match(regex);

  if (match) {
    results.push({
      json: {
        clickupUrl: url,
        workspaceId: match[1],
        docId: match[2],
      }
    });
  }
}

return results;

const output = [];

for (const item of $input.all()) {
  const pages = item.json.pages || [];
  const tableName = item.json.name;
  const baseName = $('Get ClickUp Doc Details').first().json.name;

  for (const page of pages) {
    const rawContent = page.content || "";
    const content = rawContent.trim();

    if (content.includes("* * *")) {
      const splitContents = content.split("* * *");

      for (const part of splitContents) {
        const trimmed = part.trim();
        if (!trimmed) continue;

        let contentText = trimmed;
        let notesText = "";

        if (trimmed.toLowerCase().includes("notes:")) {
          const [main, ...notesParts] = trimmed.split(/notes:/i);
          contentText = main.trim();
          notesText = notesParts.join("notes:").trim();
        }

        // Remove all '*' and re-trim
        contentText = contentText.replace(/\*/g, '').trim();

        output.push({
          json: {
            base: baseName,
            table: tableName,
            name: page.name,
            content: contentText,
            notes: notesText
          }
        });
      }
    } else {
      let contentText = content;
      let notesText = "";

      if (content.toLowerCase().includes("notes:")) {
        const [main, ...notesParts] = content.split(/notes:/i);
        contentText = main.trim();
        notesText = notesParts.join("notes:").trim();
      }

      // Remove all '*' and re-trim
      contentText = contentText.replace(/\*/g, '').trim();

      output.push({
        json: {
          base: baseName,
          table: tableName,
          name: page.name,
          content: contentText,
          notes: notesText
        }
      });
    }
  }
}

return output;

